import React from 'react'
import { NavLink } from 'react-router-dom';
// import './NBar.css';

const NavBar = () => {
  return (
    <>
   <NavLink exact activeClassName = 'active-class' className='khan'to="/">About us</NavLink>
<NavLink exact activeClassName = 'active-class' className='khan' to="/contact">Contact us</NavLink>
    <br />
      <a href="/"> Aboutpage </a>
      <a href="/contact"> Conactpage </a>
    </>
  )
}

export default NavBar
